onMetadata":null,"streamStates":{},"nuid":"21d8692c-e2be-47ec-bc4a-72f33b2ba191"},{"version":"CommandV1","origId":3737261653513180,"guid":"fa57cbc8-ee27-4024-9f21-d6c4bef7f5b0","subtype":"command","commandType":"auto","position":28.0,"command":"%md Spark MLLib supports both `regressors` and `classifiers`, in this example you will use linear regression.  Once you create the `regressor` you will train it, and it will return a `Model`. The `Model` will be the object you use to make predictions.\n\n* Create an instance of the `LinearRegression` algorithm called `lrModel`:\n* Set the label column to \"count\"\n* Set the features column to \"features\"\n* Set the \"ElasticNetParam\" to 0.5 (this controlls the mix of l1 and l2 regularization--we'll just use an equal amount of each)\n* Print the results of calling `explainParams` on `lrModel`.  This will show you all the possible parameters, and whether or not you have customized them.","commandVersion":1,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":1495650200345,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"77608f09-e30e-442d-a629-156ca46eb808"},{"version":"CommandV1","origId":3737261653513181,"guid":"99366ed5-af17-4d35-935e-fd11a3a599e9","subtype":"command","commandType":"auto","position":29.0,"command":"from pyspark.ml.regression import LinearRegression\n\nlrModel = LinearRegression()\\\n  .setLabelCol(\"count\")\\\n  .setFeaturesCol(\"features\")\\\n  .setElasticNetParam(0.5)\n\nprint(\"Printing out the model Parameters:\")\nprint(\"-\"*20)\nprint(lrModel.explainParams())\nprint(\"-\"*20)","commandVersion":1,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\">Printing out the model Parameters:\n--------------------\naggregationDepth: suggested depth for treeAggregate (&gt;= 2). (default: 2)\nelasticNetParam: the ElasticNet mixing parameter, in range [0, 1]. For alpha = 0, the penalty is an L2 penalty. For alpha = 1, it is an L1 penalty. (default: 0.0, current: 0.5)\nfeaturesCol: features column name. (default: features, current: features)\nfitIntercept: whether to fit an intercept term. (default: True)\nlabelCol: label column name. (default: label, current: count)\nmaxIter: max number of iterations (&gt;= 0). (default: 100)\npredictionCol: prediction column name. (default: prediction)\nregParam: regularization parameter (&gt;= 0). (default: 0.0)\nsolver: the solver algorithm for optimization. If this is not set or empty, default value is &apos;auto&apos;. (default: auto)\nstandardization: whether to standardize the training features before fitting the model. (default: True)\ntol: the convergence tolerance for iterative algorithms (&gt;= 0). (default: 1e-06)\nweightCol: weight column name. If this is not set or empty, we treat all instance weights as 1.0. (undefined)\n--------------------\n</div>","arguments":{},"addedWidgets":{},"removedWidgets":[]},"errorSummary":null,"error":null,"workflows":[],"startTime":1495650280510,"submitTime":1495650200365,"finishTime":1495650280709,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"ed96daa7- k.ml.regression import RandomForestRegressor\nfrom pyspark.ml.tuning import ParamGridBuilder, CrossValidator\nfrom pyspark.ml import Pipeline\nfrom pyspark.ml.evaluation import RegressionEvaluator\n\nrfModel = RandomForestRegressor()\\\n  .setLabelCol(\"count\")\\\n  .setFeaturesCol(\"features\")\n  \nparamGrid = ParamGridBuilder()\\\n  .addGrid(rfModel.maxDepth, [5, 10])\\\n  .addGrid(rfModel.numTrees, [20, 60])\\\n  .build()\n\nsteps = [rfModel]\n\npipeline = Pipeline().setStages(steps)\n\ncv = CrossValidator()\\\n  .setEstimator(pipeline)\\\n  .setEstimatorParamMaps(paramGrid)\\\n  .setEvaluator(RegressionEvaluator().setLabelCol(\"count\"))\n\npipelineFitted = cv.fit(training)","commandVersion":1,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\"></div>","arguments":{},"addedWidgets":{},"removedWidgets":[]},"errorSummary":null,"error":null,"workflows":[],"startTime":1495650315087,"submitTime":1495650200473,"finishTime":1495652634903,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"a user","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"streamStates":{},"nuid":"987079bf-ebf5-4cfa-bf00-1c6dbfd3d30a"},{"version":"CommandV1","origId":3737261653513194,"guid":"803e6d86-c8cf-4198-96a2-245b4ced5a93","subtype":"command","commandType":"auto","position":42.0,"command":"%md * Access the best model on the `pipelineFitted` object by accessing the first stage of the `bestModel` attribute.","commandVersion":1,"state":"finished","results":null,"errorSummary":null,"error":null,"workflows":[],"startTime":0,"submitTime":1495650200478,"finishTime":0,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"tab
